import Navbar from '../components/Navbar';

const Index = () => (
  <div>
    <Navbar />
    <h1>Hello HomePage</h1>

    <style jsx>
      {`
        h1 {
          background-color: blue;
          padding: 100px;
        }
      `}
    </style>
  </div>
);

export default Index;
